import styled from '@emotion/styled';
import {Paper, Stack, Typography } from '@mui/material'
import React from 'react'

const DemoPaper = styled(Paper)(({ theme }) => ({

    width: 1000,
    height:800,
    textAlign: 'center',
    borderRadius:"50px",
  }));

const Login = () => {
  return (
    <Stack display="flex" direction="column" justifyContent="center">
        <Stack bgcolor="white" display="flex" direction="row" justifyContent="center">
            <DemoPaper elevation={6}>
                <Stack>

                </Stack>
                <Typography variant="h3">Login Form</Typography>
            </DemoPaper>
        </Stack>
    </Stack>

  )
}

export default Login
